/*Table structure for table `sys_dictionary` */

DROP TABLE IF EXISTS `sys_dictionary`;

CREATE TABLE `sys_dictionary` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `dictionary_id` int(11) DEFAULT NULL COMMENT '字典id',
  `name` varchar(502) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '名称',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父级id',
  `remark` varchar(765) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  `reserver1` varchar(765) DEFAULT NULL,
  `reserver2` varchar(765) DEFAULT NULL,
  `sort_id` int(11) DEFAULT NULL COMMENT '序号',
  `type` int(11) DEFAULT NULL COMMENT '类型  1:父类 ; 2:子类',
  `value` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '值',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='字典';

/*Data for the table `sys_dictionary` */

